(1, 'seo.data', '{\"seo_image\":\"1\",\"keywords\":[\"bus booking system\",\"bus booking php script\",\"multivendor bus booking system\",\"vindhyashri ecom private limited\",\"bus booking in reva\",\"online bus booking\"],\"description\":\"Book affordable and reliable bus tickets online with our user-friendly platform. Choose from a wide range of routes, enjoy hassle-free booking, and experience a comfortable journey. Secure your seat today\",\"social_title\":\"Vindhyashri Ecom Private Limited - Ghumantoo\",\"social_description\":\"Book affordable and reliable bus tickets online with our user-friendly platform. Choose from a wide range of routes, enjoy hassle-free booking, and experience a comfortable journey. Secure your seat today\",\"image\":\"66ea6940edd2a1726638400.png\"}', '2020-07-04 23:42:52', '2024-09-18 05:46:41'),
(24, 'about.content', '{\"has_image\":\"1\",\"heading\":\"Discover the Journey Behind Ghumantoo: Your Trusted Travel Partner\",\"short_description\":\"<div class=\\\"section-header\\\" style=\\\"margin-bottom:20px;\\\"><p style=\\\"margin-right:0px;margin-left:0px;padding:0px;\\\"><font face=\\\"Lato, sans-serif\\\"><span style=\\\"font-size:18px;\\\">At Ghumantoo, we believe that every journey should be memorable, comfortable, and convenient. As an emerging online bus service platform, our mission is to redefine how people experience bus travel in India. We are committed to providing a smooth, hassle-free booking experience with an intuitive interface that caters to the needs of modern-day travelers. Whether you\'re planning a short trip or a cross-country adventure, Ghumantoo ensures that your journey is as enjoyable as your destination.<\\/span><\\/font><\\/p><p style=\\\"margin-right:0px;margin-left:0px;padding:0px;\\\"><font face=\\\"Lato, sans-serif\\\"><span style=\\\"font-size:18px;\\\"><br \\/><\\/span><\\/font><\\/p><p style=\\\"margin-right:0px;margin-left:0px;padding:0px;\\\"><font face=\\\"Lato, sans-serif\\\"><span style=\\\"font-size:18px;\\\">We bring technology and customer service together to offer you a range of trusted and affordable travel options. Our platform is designed to make booking easier, providing access to a wide network of buses operating across cities and rural areas alike. From secure payment gateways to round-the-clock customer support, Ghumantoo is dedicated to ensuring a reliable travel experience every step of the way.<\\/span><\\/font><\\/p><p style=\\\"margin-right:0px;margin-left:0px;padding:0px;\\\"><font face=\\\"Lato, sans-serif\\\"><span style=\\\"font-size:18px;\\\"><br \\/><\\/span><\\/font><\\/p><p style=\\\"margin-right:0px;margin-left:0px;padding:0px;\\\"><font face=\\\"Lato, sans-serif\\\"><span style=\\\"font-size:18px;\\\">Why Choose Ghumantoo?<\\/span><\\/font><\\/p><p style=\\\"margin-right:0px;margin-left:0px;padding:0px;\\\"><font face=\\\"Lato, sans-serif\\\"><span style=\\\"font-size:18px;white-space:normal;\\\"><span style=\\\"white-space:pre;\\\">\\t<\\/span>Extensive Travel Network: We connect you to a broad selection of bus operators across India.<\\/span><\\/font><\\/p><p style=\\\"margin-right:0px;margin-left:0px;padding:0px;\\\"><font face=\\\"Lato, sans-serif\\\"><span style=\\\"font-size:18px;white-space:normal;\\\"><span style=\\\"white-space:pre;\\\">\\t<\\/span>Seamless Booking Process: Our user-friendly platform makes ticket booking quick and easy.<\\/span><\\/font><\\/p><p style=\\\"margin-right:0px;margin-left:0px;padding:0px;\\\"><font face=\\\"Lato, sans-serif\\\"><span style=\\\"font-size:18px;white-space:normal;\\\"><span style=\\\"white-space:pre;\\\">\\t<\\/span>Reliable &amp; Transparent Pricing: Enjoy clear, affordable pricing with no hidden fees.<\\/span><\\/font><\\/p><p style=\\\"margin-right:0px;margin-left:0px;padding:0px;\\\"><font face=\\\"Lato, sans-serif\\\"><span style=\\\"font-size:18px;white-space:normal;\\\"><span style=\\\"white-space:pre;\\\">\\t<\\/span>Secure Transactions: Multiple payment options with a strong emphasis on security.<\\/span><\\/font><\\/p><p style=\\\"margin-right:0px;margin-left:0px;padding:0px;\\\"><font face=\\\"Lato, sans-serif\\\"><span style=\\\"font-size:18px;white-space:normal;\\\"><span style=\\\"white-space:pre;\\\">\\t<\\/span>24\\/7 Customer Support: We\'re here to assist you any time, before or during your trip.<\\/span><\\/font><\\/p><p style=\\\"margin-right:0px;margin-left:0px;padding:0px;\\\"><font face=\\\"Lato, sans-serif\\\"><span style=\\\"font-size:18px;\\\"><br \\/><\\/span><\\/font><\\/p><p style=\\\"margin-right:0px;margin-left:0px;padding:0px;\\\"><font face=\\\"Lato, sans-serif\\\"><span style=\\\"font-size:18px;\\\">At Ghumantoo, we don\\u2019t just help you book a bus\\u2014we help you embark on a worry-free journey!<\\/span><\\/font><\\/p><\\/div>\",\"title\":\"About Us\",\"description\":\"<div class=\\\"item\\\" style=\\\"margin-bottom:30px;color:rgb(119,119,119);font-family:Lato, sans-serif;\\\"><h3><\\/h3><p><strong><br \\/><\\/strong><\\/p><p><strong>Ghumantoo<\\/strong> is an innovative online bus service provider based in Reva, Madhya Pradesh, India. As a trusted platform, we aim to revolutionize the way travellers book bus tickets by offering seamless, efficient, and reliable services across India. Whether you\'re planning a quick getaway or a long-distance journey, Ghumantoo ensures you have a hassle-free booking experience at your fingertips.<\\/p><p><\\/p><p><br \\/><\\/p><p>We are a proud venture of <strong>Vindhyashri Ecom Private Limited<\\/strong>, a company registered under the Ministry of Corporate Affairs (CIN: U46901MP2024PTC069267). Ghumantoo leverages advanced technology and a customer-centric approach to offer a seamless and intuitive online bus booking experience. With a wide array of travel options and a commitment to reliability and convenience, we strive to make bus travel easier, faster, and more accessible for every Indian traveller.<\\/p><p><br \\/><\\/p><p>Our platform is designed with user-friendly features, secure payment gateways, and an extensive network of bus operators, ensuring that travellers can effortlessly plan their journeys across various destinations in India. At Ghumantoo, we prioritize customer satisfaction by continually enhancing our services to meet the evolving needs of modern-day travellers. We also provide pay on board option so that you don\'t need to worry more about payment before boarding.<\\/p><p><br \\/><\\/p><h4>Key Features:<\\/h4><h4><strong style=\\\"color:rgb(91,110,136);font-size:0.875rem;\\\"><br \\/><\\/strong><\\/h4><h4><strong style=\\\"color:rgb(91,110,136);font-size:0.875rem;\\\">Wide Network of Buses<\\/strong><span style=\\\"font-size:0.875rem;font-weight:bolder;\\\">: We offer a vast selection of bus services connecting cities, towns, and rural areas across India.<\\/span><\\/h4><strong style=\\\"color:rgb(91,110,136);font-size:0.875rem;\\\">User-Friendly Booking Platform<\\/strong><span style=\\\"font-size:0.875rem;font-weight:bolder;\\\">: Our platform is designed to ensure smooth navigation and easy booking, whether on desktop or mobile.<\\/span><strong style=\\\"color:rgb(91,110,136);font-size:0.875rem;\\\"><br \\/><\\/strong><strong style=\\\"color:rgb(91,110,136);font-size:0.875rem;\\\">Secure Payment Options<\\/strong><span style=\\\"font-size:0.875rem;font-weight:bolder;\\\">: Enjoy peace of mind with secure payment gateways and multiple transaction methods.<\\/span><strong style=\\\"color:rgb(91,110,136);font-size:0.875rem;\\\"><br \\/><\\/strong><strong style=\\\"color:rgb(91,110,136);font-size:0.875rem;\\\">24\\/7 Customer Support<\\/strong><span style=\\\"font-size:0.875rem;font-weight:bolder;\\\">: We are here for you at every step of your journey with dedicated customer service.<\\/span><strong style=\\\"color:rgb(91,110,136);font-size:0.875rem;\\\"><br \\/><\\/strong><strong style=\\\"color:rgb(91,110,136);font-size:0.875rem;\\\">Transparent Pricing<\\/strong><span style=\\\"font-size:0.875rem;font-weight:bolder;\\\">: No hidden charges\\u2014just clear, competitive prices for every trip.<\\/span><\\/div><div class=\\\"item\\\" style=\\\"margin-bottom:30px;color:rgb(119,119,119);font-family:Lato, sans-serif;\\\"><p><br \\/><\\/p><p>At <strong>Ghumantoo<\\/strong>, we are dedicated to delivering top-notch travel experiences, making us the go-to solution for bus bookings across the country.<\\/p><\\/div><h2 class=\\\"title\\\" style=\\\"margin-top:-10px;margin-bottom:15px;font-weight:600;line-height:1.2;font-size:36px;color:rgb(66,66,72);font-family:Georama, sans-serif;\\\"><\\/h2>\",\"image\":\"61f24107cbedc1643266311.jpg\"}', '2020-10-28 00:51:20', '2024-10-05 12:45:50'),
