(51, 'faq.content', '{\"heading\":\"Frequently Asked Questions\",\"sub_heading\":\"Whether you need assistance with making a reservation, checking your booking status, or understanding our cancellation policy, we\\u2019re here to help! If you can\\u2019t find the information you need, feel free to reach out to our friendly customer support team for personalized assistance. Your travel experience is our priority!\"}', '2022-01-26 10:48:26', '2024-10-05 13:02:17'),
(52, 'faq.element', '{\"question\":\"How do I book a bus ticket with Ghumantoo?\",\"answer\":\"You can easily book a bus ticket by visiting our website or using our mobile app. Simply select your travel route, choose your preferred bus, and follow the prompts to complete your booking.\"}', '2022-01-26 10:49:06', '2024-10-05 13:03:42'),
(53, 'faq.element', '{\"question\":\"What payment methods do you accept?\",\"answer\":\"We accept a variety of secure payment options, including credit\\/debit cards, net banking, and popular digital wallets, ensuring a safe transaction for our customers.\"}', '2022-01-26 10:49:32', '2024-10-05 13:04:08'),
(54, 'faq.element', '{\"question\":\"How can I contact customer support?\",\"answer\":\"You can reach our customer support team through the contact form on our website, or by calling our helpline . We\\u2019re available 24\\/7 to assist you with any inquiries.\"}', '2022-01-26 10:49:44', '2024-10-05 13:08:56'),
(55, 'testimonials.content', '{\"heading\":\"Why Choose Ghumantoo for Bus Ticket Booking ?\",\"sub_heading\":\"Ghumantoo is the fastest growing online ticket booking platform. We partner with several State Road Transport Corporation (SRTC) operators and over 1000+ private bus partners covering more than 50,000 bus routes across India\"}', '2022-01-26 11:37:13', '2024-09-26 14:07:52'),
