(68, 'footer.content', '{\"short_description\":\"Ghumantoo, A joint venture of Vindhyashri Ecom Private Limited is fastest growing online bus ticket booking service trusted customers globally. ghumantoo offers bus ticket booking through its website, iOS and Android mobile apps for all major routes in India\"}', '2022-01-27 06:44:26', '2024-10-05 13:26:27'),
(69, 'policies.element', '{\"title\":\"Privacy Policy\",\"details\":\"<h4 class=\\\"title\\\" style=\\\"text-align:center;margin:0px 0px 15px;font-weight:600;line-height:1.2;font-size:24px;color:rgb(66,66,72);font-family:Georama, sans-serif;\\\">Privacy Policy for Ghumantoo<br \\/><\\/h4><div><p><strong>Effective Date:<\\/strong> [30 Sep 2024]<\\/p><p>At Ghumantoo, we value your privacy and are committed to safeguarding your personal information. This Privacy Policy outlines how we collect, use, store, and protect your data when you use our bus ticket booking platform. By using Ghumantoo, you agree to the terms set forth in this policy.<\\/p><p><br \\/><\\/p><p><b><font size=\\\"5\\\">Overview<\\/font><\\/b><br \\/><\\/p><p><font size=\\\"3\\\" face=\\\"helvetica\\\"><span style=\\\"color:rgb(33,37,41);\\\">We are a proud venture of <\\/span><strong style=\\\"color:rgb(33,37,41);\\\">Vindhyashri Ecom Private Limited<\\/strong><span style=\\\"color:rgb(33,37,41);\\\">, a company registered under the Ministry of Corporate Affairs (CIN: U46901MP2024PTC069267).\\u00a0<\\/span>Ghumantoo (\\\"we,\\\" \\\"our,\\\" or \\\"us\\\") respects your privacy and is committed to protecting your personal data. This Privacy Policy explains how we collect and use your information when you access our website or mobile application to browse or make bus ticket bookings.<\\/font><\\/p><p><font size=\\\"3\\\" face=\\\"helvetica\\\">This policy applies to all users (\\\"you,\\\" \\\"your\\\") of our services, and it is governed by Indian laws, including the Information Technology (Reasonable Security Practices and Procedures and Sensitive Personal Data or Information) Rules, 2011, and the General Data Protection Regulation (GDPR), where applicable.<\\/font><\\/p><p><br \\/><\\/p><h3><strong>Data Collection &amp; Use<\\/strong><\\/h3><p>When you use Ghumantoo, we collect the following types of data:<\\/p><p><br \\/><\\/p><h4>a) <strong>Personal Data:<\\/strong><\\/h4><p><\\/p><ol><li>We collect personal data when you:<\\/li><li><span style=\\\"font-size:0.875rem;\\\">Register or create an account on Ghumantoo (name, email address, phone number, password, etc.).<\\/span><\\/li><li><span style=\\\"font-size:0.875rem;\\\">Book tickets (payment details, travel preferences, etc.).<\\/span><\\/li><li><span style=\\\"font-size:0.875rem;\\\">Communicate with our customer service team (email or call records).<\\/span><\\/li><\\/ol><p><strong>Why We Collect It:<\\/strong><\\/p><ul><li>To manage your account and bookings.<\\/li><li>To process payments and provide you with tickets.<\\/li><li>To send important service-related notifications (such as booking confirmations, cancellation alerts, etc.).<\\/li><li>To enhance your overall experience by customizing content, services, and offers.<\\/li><\\/ul><h4>b) <strong>Non-Personal Data:<\\/strong><\\/h4><p>This includes:<\\/p><ul><li>Browsing information (IP address, browser type, operating system, etc.).<\\/li><li>Location data (based on your device settings).<\\/li><\\/ul><p><strong>Why We Collect It:<\\/strong><\\/p><ul><li>To improve the performance and functionality of our platform.<\\/li><li>To analyze website traffic and enhance user experience.<\\/li><\\/ul><h3><strong>Cookies Data<\\/strong><\\/h3><p>Cookies are small text files placed on your device when you visit our website or use our app. These files help us to enhance your experience by remembering your preferences and improving the overall performance of the platform.<\\/p><h4>a) <strong>Types of Cookies We Use:<\\/strong><\\/h4><ol><li><p><strong>Essential Cookies:<\\/strong>\\nThese cookies are required for the basic functionalities of our website, such as logging in and booking tickets.<\\/p><\\/li><li><p><strong>Performance Cookies:<\\/strong>\\nThese cookies collect information about how visitors interact with our platform, helping us to improve our services.<\\/p><\\/li><li><p><strong>Targeting Cookies:<\\/strong>\\nThese are used to display advertisements relevant to you and track the effectiveness of marketing campaigns.<\\/p><\\/li><\\/ol><h4>b) <strong>How We Use Cookies:<\\/strong><\\/h4><ul><li>To remember your login credentials and provide a seamless booking experience.<\\/li><li>To analyze and understand user interactions to enhance website performance.<\\/li><li>To show you personalized advertisements based on your browsing habits.<\\/li><\\/ul><h4>c) <strong>Managing Cookies:<\\/strong><\\/h4><p>You can control the use of cookies through your browser settings. Please note that disabling cookies may limit some features of our platform.<\\/p><br \\/><h3><strong>Data Storage<\\/strong><\\/h3><p>Ghumantoo securely stores your data on servers located in India. We follow industry-standard security protocols to protect your personal data from unauthorized access, alteration, disclosure, or destruction.<\\/p><h4>a) <strong>Duration of Data Storage:<\\/strong><\\/h4><p>We retain your personal data for as long as necessary to provide you with the services you request, or as required by law. After this period, your data will either be anonymized or securely deleted.<\\/p><h4>b) <strong>Data Protection Measures:<\\/strong><\\/h4><p>We use advanced security measures, including:<\\/p><ul><li>Encryption for sensitive data such as payment information.<\\/li><li>Regular security audits and updates to protect against breaches.<\\/li><\\/ul><h4>c) <strong>Third-Party Sharing:<\\/strong><\\/h4><p>We do not share your personal data with third parties, except for service providers who assist us in operating our platform (such as payment processors) and only to the extent necessary for the provision of services.<\\/p><p><br \\/><\\/p><h3><strong>Your Rights<\\/strong><\\/h3><p>You have the right to:<\\/p><ul><li>Access, update, or delete your personal information.<\\/li><li>Withdraw consent for data collection or processing at any time.<\\/li><li>Request the transfer of your data to another service provider.<\\/li><\\/ul><p>If you wish to exercise any of these rights, please contact us at [Insert Email Address].<\\/p><p><br \\/><\\/p><h3><strong>Changes to This Policy<\\/strong><\\/h3><p>We may update this Privacy Policy from time to time to reflect changes in our practices or applicable laws. Any changes will be posted on our website, and we encourage you to review this policy periodically.<\\/p><p><br \\/><\\/p><h3><strong>Contact Us<\\/strong><\\/h3><p>If you have any questions or concerns about this Privacy Policy, please contact us:<\\/p><p>Ghumantoo Customer Support<br \\/>Email: info@vindhyashrisolutions.com<br \\/>Phone: [Insert Phone Number]<\\/p><hr \\/><\\/div>\"}', '2022-01-27 07:01:56', '2024-10-05 13:29:52'),
(71, 'policies.element', '{\"title\":\"Terms and Conditions\",\"details\":\"<h4 class=\\\"title\\\" style=\\\"margin:0px 0px 15px;font-weight:600;line-height:1.2;font-size:24px;color:rgb(66,66,72);font-family:Georama, sans-serif;\\\"><\\/h4><div class=\\\"flex max-w-full flex-col flex-grow\\\"><div class=\\\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words [.text-message+&amp;]:mt-5\\\"><div class=\\\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\\\"><div class=\\\"markdown prose w-full break-words dark:prose-invert dark\\\"><p><\\/p><ul><li>Welcome to Ghumantoo! These Terms and Conditions outline the rules and regulations for the use of our services. By accessing or using our website and services, you agree to comply with and be bound by these terms. Please read them carefully.<\\/li><\\/ul><\\/div><\\/div><\\/div><\\/div><h2><font size=\\\"4\\\">1. Acceptance of Terms<\\/font><\\/h2><h4 class=\\\"title\\\" style=\\\"margin:0px 0px 15px;font-weight:600;line-height:1.2;font-size:24px;color:rgb(66,66,72);font-family:Georama, sans-serif;\\\"><\\/h4><div class=\\\"flex max-w-full flex-col flex-grow\\\"><div class=\\\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words [.text-message+&amp;]:mt-5\\\"><div class=\\\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\\\"><div class=\\\"markdown prose w-full break-words dark:prose-invert dark\\\"><p>By using Ghumantoo, you confirm that you accept these Terms and Conditions. If you do not agree with any part of these terms, you must not use our services.<\\/p><\\/div><\\/div><\\/div><\\/div><h2><font size=\\\"4\\\">2. Definitions<\\/font><\\/h2><h4 class=\\\"title\\\" style=\\\"margin:0px 0px 15px;line-height:1.2;font-size:24px;color:rgb(66,66,72);font-family:Georama, sans-serif;\\\"><\\/h4><div class=\\\"flex max-w-full flex-col flex-grow\\\"><div class=\\\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words [.text-message+&amp;]:mt-5\\\"><div class=\\\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\\\"><div class=\\\"markdown prose w-full break-words dark:prose-invert dark\\\"><strong style=\\\"font-weight:600;color:rgb(91,110,136);font-size:0.875rem;\\\">Service<\\/strong><span style=\\\"font-size:0.875rem;\\\"><b>: <\\/b>Refers to the bus booking services provided by Ghumantoo.<\\/span><\\/div><div class=\\\"markdown prose w-full break-words dark:prose-invert dark\\\"><strong style=\\\"font-weight:600;color:rgb(91,110,136);font-size:0.875rem;\\\">User<\\/strong><span style=\\\"font-size:0.875rem;\\\"><b>: <\\/b>Any individual who accesses the Ghumantoo platform and uses its services.<\\/span><br \\/><strong style=\\\"font-weight:600;color:rgb(91,110,136);font-size:0.875rem;\\\">Booking<\\/strong><span style=\\\"font-weight:600;font-size:0.875rem;\\\">: <\\/span><span style=\\\"font-size:0.875rem;\\\">The process of reserving a seat on a bus through our platform.<\\/span><br \\/><\\/div><\\/div><\\/div><\\/div><h4 class=\\\"title\\\" style=\\\"margin:0px 0px 15px;line-height:1.2;font-size:24px;color:rgb(66,66,72);font-family:Georama, sans-serif;\\\"><\\/h4><div class=\\\"flex max-w-full flex-col flex-grow\\\"><div class=\\\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words [.text-message+&amp;]:mt-5\\\"><div class=\\\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\\\"><div class=\\\"markdown prose w-full break-words dark:prose-invert dark\\\"><ul><li><font size=\\\"4\\\">3. User Responsibilities<\\/font><\\/li><li>You must provide accurate and complete information when making a booking.<\\/li><li>You are responsible for maintaining the confidentiality of your account details.<\\/li><li>You agree to notify us immediately of any unauthorized use of your account.<\\/li><li><br \\/><\\/li><\\/ul><span style=\\\"font-size:large;\\\">4. Booking Process<\\/span><br \\/><\\/div><\\/div><\\/div><\\/div><h4 class=\\\"title\\\" style=\\\"margin:0px 0px 15px;line-height:1.2;color:rgb(66,66,72);\\\"><\\/h4><div class=\\\"flex max-w-full flex-col flex-grow\\\"><div class=\\\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words [.text-message+&amp;]:mt-5\\\"><div class=\\\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\\\"><div class=\\\"markdown prose w-full break-words dark:prose-invert dark\\\"><font size=\\\"2\\\" face=\\\"helvetica\\\"><b style=\\\"color:rgb(91,110,136);\\\"><font>Users can book bus tickets through our website or mobile app.<\\/font><\\/b><br \\/><b style=\\\"color:rgb(91,110,136);\\\">A confirmed booking will be sent via email or SMS.<\\/b><br \\/><b style=\\\"color:rgb(91,110,136);\\\"><font>It is your responsibility to ensure that all details in the booking confirmation are correct.<\\/font><\\/b><\\/font><br \\/><\\/div><\\/div><\\/div><\\/div><p><font size=\\\"4\\\">5. Payment Terms<\\/font><\\/p><p><\\/p><ul><li><b><font size=\\\"2\\\" face=\\\"helvetica\\\">All payments must be made in full at the time of booking.<\\/font><\\/b><\\/li><\\/ul><ul><li><b><font size=\\\"2\\\" face=\\\"helvetica\\\">We accept various payment methods, including credit\\/debit cards, net banking, and digital wallets.<\\/font><\\/b><\\/li><\\/ul><ul><li><b><font size=\\\"2\\\" face=\\\"helvetica\\\">You are responsible for any fees related to your payment method.<\\/font><\\/b><\\/li><\\/ul><p><font size=\\\"4\\\">6. Cancellation and Refund Policy<\\/font><\\/p><ul><li><font face=\\\"helvetica\\\">Cancellations can be made through your account or by contacting customer support.<\\/font><\\/li><\\/ul><ul><li><font face=\\\"helvetica\\\">Refunds are subject to our cancellation policy, which varies based on the bus operator and the timing of the cancellation.<\\/font><\\/li><\\/ul><ul><li><font face=\\\"helvetica\\\">Refunds may take several business days to process, depending on your bank or payment method.<\\/font><\\/li><\\/ul><h2><font size=\\\"4\\\">7. Changes to Bookings<\\/font><\\/h2><h4 class=\\\"title\\\" style=\\\"margin:0px 0px 15px;font-weight:600;line-height:1.2;font-size:24px;color:rgb(66,66,72);font-family:Georama, sans-serif;\\\"><\\/h4><div class=\\\"flex max-w-full flex-col flex-grow\\\"><div class=\\\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words [.text-message+&amp;]:mt-5\\\"><div class=\\\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\\\"><div class=\\\"markdown prose w-full break-words dark:prose-invert dark\\\"><ul><li>You may request changes to your booking through our platform before the scheduled departure.<\\/li><li>Changes are subject to availability and may incur additional fees.<\\/li><li>Not all bookings can be modified; please refer to the specific bus operator\'s terms.<\\/li><\\/ul><\\/div><\\/div><\\/div><\\/div><h2><font size=\\\"4\\\">8. Travel Regulations<\\/font><\\/h2><h4 class=\\\"title\\\" style=\\\"margin:0px 0px 15px;font-weight:600;line-height:1.2;font-size:24px;color:rgb(66,66,72);font-family:Georama, sans-serif;\\\"><\\/h4><div class=\\\"flex max-w-full flex-col flex-grow\\\"><div class=\\\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words [.text-message+&amp;]:mt-5\\\"><div class=\\\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\\\"><div class=\\\"markdown prose w-full break-words dark:prose-invert dark\\\"><ul><li>Users are responsible for adhering to all travel regulations, including those related to identification and documentation.<\\/li><li>It is your responsibility to arrive at the boarding point on time.<\\/li><li>Ghumantoo is not liable for any loss or delay due to your failure to comply with travel regulations.<\\/li><\\/ul><\\/div><\\/div><\\/div><\\/div><h2><font size=\\\"4\\\">9. Limitation of Liability<\\/font><\\/h2><h4 class=\\\"title\\\" style=\\\"margin:0px 0px 15px;font-weight:600;line-height:1.2;font-size:24px;color:rgb(66,66,72);font-family:Georama, sans-serif;\\\"><\\/h4><div class=\\\"flex max-w-full flex-col flex-grow\\\"><div class=\\\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words [.text-message+&amp;]:mt-5\\\"><div class=\\\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\\\"><div class=\\\"markdown prose w-full break-words dark:prose-invert dark\\\"><ul><li>Ghumantoo is not responsible for any direct, indirect, or incidental damages arising from the use of our services.<\\/li><li>We do not guarantee the availability of buses or services and are not liable for cancellations or delays caused by the bus operator.<\\/li><\\/ul><\\/div><\\/div><\\/div><\\/div><h2><font size=\\\"4\\\">10. Force Majeure<\\/font><\\/h2><h4 class=\\\"title\\\" style=\\\"margin:0px 0px 15px;font-weight:600;line-height:1.2;font-size:24px;color:rgb(66,66,72);font-family:Georama, sans-serif;\\\"><\\/h4><div class=\\\"flex max-w-full flex-col flex-grow\\\"><div class=\\\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words [.text-message+&amp;]:mt-5\\\"><div class=\\\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\\\"><div class=\\\"markdown prose w-full break-words dark:prose-invert dark\\\"><ul><li>Ghumantoo is not liable for any failure to perform our obligations due to circumstances beyond our control, including natural disasters, strikes, or other unforeseen events.<\\/li><\\/ul><\\/div><\\/div><\\/div><\\/div><h2><font size=\\\"4\\\">11. User Conduct<\\/font><\\/h2><h4 class=\\\"title\\\" style=\\\"margin:0px 0px 15px;font-weight:600;line-height:1.2;font-size:24px;color:rgb(66,66,72);font-family:Georama, sans-serif;\\\"><\\/h4><div class=\\\"flex max-w-full flex-col flex-grow\\\"><div class=\\\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words [.text-message+&amp;]:mt-5\\\"><div class=\\\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\\\"><div class=\\\"markdown prose w-full break-words dark:prose-invert dark\\\"><ul><li>Users agree not to use the Ghumantoo platform for any unlawful or prohibited activities.<\\/li><li>You may not interfere with the security of our services or attempt to gain unauthorized access to our systems.<\\/li><\\/ul><\\/div><\\/div><\\/div><\\/div><h2><font size=\\\"4\\\">12. Intellectual Property<\\/font><\\/h2><h4 class=\\\"title\\\" style=\\\"margin:0px 0px 15px;font-weight:600;line-height:1.2;font-size:24px;color:rgb(66,66,72);font-family:Georama, sans-serif;\\\"><\\/h4><div class=\\\"flex max-w-full flex-col flex-grow\\\"><div class=\\\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words [.text-message+&amp;]:mt-5\\\"><div class=\\\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\\\"><div class=\\\"markdown prose w-full break-words dark:prose-invert dark\\\"><ul><li>All content on the Ghumantoo website and app, including text, graphics, logos, and software, is the property of Ghumantoo and is protected by copyright laws.<\\/li><li>You may not reproduce, distribute, or modify any content without our prior written consent.<\\/li><\\/ul><\\/div><\\/div><\\/div><\\/div><h2><font size=\\\"4\\\">13. Governing Law<\\/font><\\/h2><h4 class=\\\"title\\\" style=\\\"margin:0px 0px 15px;font-weight:600;line-height:1.2;font-size:24px;color:rgb(66,66,72);font-family:Georama, sans-serif;\\\"><\\/h4><div class=\\\"flex max-w-full flex-col flex-grow\\\"><div class=\\\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words [.text-message+&amp;]:mt-5\\\"><div class=\\\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\\\"><div class=\\\"markdown prose w-full break-words dark:prose-invert dark\\\"><ul><li>These Terms and Conditions are governed by the laws of India.<\\/li><li>Any disputes arising from these terms will be subject to the jurisdiction of the courts in Reva, Madhya Pradesh.<\\/li><\\/ul><\\/div><\\/div><\\/div><\\/div><h2><font size=\\\"4\\\">14. Changes to Terms<\\/font><\\/h2><h4 class=\\\"title\\\" style=\\\"margin:0px 0px 15px;font-weight:600;line-height:1.2;font-size:24px;color:rgb(66,66,72);font-family:Georama, sans-serif;\\\"><\\/h4><div class=\\\"flex max-w-full flex-col flex-grow\\\"><div class=\\\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words [.text-message+&amp;]:mt-5\\\"><div class=\\\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\\\"><div class=\\\"markdown prose w-full break-words dark:prose-invert dark\\\"><ul><li>Ghumantoo reserves the right to modify these Terms and Conditions at any time. Any changes will be posted on our website.<\\/li><li>Continued use of our services after any changes constitutes your acceptance of the revised terms.<\\/li><\\/ul><\\/div><\\/div><\\/div><\\/div><h2><font size=\\\"4\\\">15. Contact Us<\\/font><\\/h2><h4 class=\\\"title\\\" style=\\\"margin:0px 0px 15px;font-weight:600;line-height:1.2;font-size:24px;color:rgb(66,66,72);font-family:Georama, sans-serif;\\\"><\\/h4><div class=\\\"flex max-w-full flex-col flex-grow\\\"><div class=\\\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words [.text-message+&amp;]:mt-5\\\"><div class=\\\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\\\"><div class=\\\"markdown prose w-full break-words dark:prose-invert dark\\\"><p>If you have any questions or concerns regarding these Terms and Conditions, please contact us at:<\\/p><ul><li><strong>Email<\\/strong>: <a>info@vindhyashrisolutions.com<\\/a><\\/li><li><strong>Phone<\\/strong>: +91-9111888584<\\/li><li><br \\/><\\/li><\\/ul><p>By using our services, you acknowledge that you have read, understood, and agree to be bound by these Terms and Conditions. Thank you for choosing Ghumantoo for your travel needs!<\\/p><\\/div><\\/div><\\/div><\\/div><div class=\\\"mb-2 flex gap-3 empty:hidden -ml-2\\\"><div class=\\\"items-center justify-start rounded-xl p-1 flex\\\"><div class=\\\"flex items-center\\\"><span><span class=\\\"flex h-[30px] w-[30px] items-center justify-center\\\"><\\/span><\\/span><span><span class=\\\"flex h-[30px] w-[30px] items-center justify-center\\\"><\\/span><\\/span><div class=\\\"flex\\\"><span><span class=\\\"flex h-[30px] w-[30px] items-center justify-center\\\"><\\/span><\\/span><span><span class=\\\"flex h-[30px] w-[30px] items-center justify-center\\\"><\\/span><\\/span><\\/div><span class=\\\"hidden\\\"><\\/span><span><\\/span><div class=\\\"flex items-center pb-0\\\"><span class=\\\"overflow-hidden text-clip whitespace-nowrap text-sm\\\"><\\/span><\\/div><\\/div><\\/div><\\/div>\"}', '2022-01-27 07:02:26', '2024-10-05 13:37:33'),
