(77, 'cookie_policy.content', '{\"title\":\"Cookie Policy\",\"details\":\"<h1 style=\\\"text-align:center;margin-top:15px;margin-bottom:15px;padding:0px;\\\"><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"6\\\"><b>Cookie Collection Policy for Ghumantoo<\\/b><\\/font><\\/font><\\/h1><p style=\\\"margin-top:15px;margin-bottom:15px;padding:0px;\\\"><\\/p><h4><span style=\\\"color:rgb(0,0,0);font-family:\'times new roman\';\\\"><font size=\\\"4\\\"><b>Introduction<\\/b><\\/font><\\/span><\\/h4><p><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">At Ghumantoo, we are committed to maintaining the trust and confidence of our customers. This Cookie Collection Policy explains how we use cookies and similar technologies on our website and mobile application, in compliance with Indian laws and regulations, including the Information Technology Act, 2000, and the Information Technology (Reasonable Security Practices and Procedures and Sensitive Personal Data or Information) Rules, 2011.<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">By using our website or app, you agree to the use of cookies in accordance with this policy. If you do not agree with the use of cookies, you may disable them by following the instructions below, but this may impact your experience on our platform.<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\"><br \\/><\\/font><\\/font><\\/p><p><\\/p><h4><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\"><b><font size=\\\"4\\\">What Are Cookies?<\\/font><\\/b><\\/font><\\/font><\\/h4><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">Cookies are small text files that are placed on your device (computer, tablet, or mobile) by websites you visit. These cookies collect information that helps us to provide you with a more personalized experience by remembering your preferences, optimizing performance, and providing targeted services.<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">We use both session cookies (which expire once you close your browser) and persistent cookies (which remain on your device until they expire or you delete them).<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\"><br \\/><\\/font><\\/font><p><\\/p><h4><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"4\\\"><b>Types of Cookies We Use<\\/b><\\/font><\\/font><\\/h4><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\"><b>1. Essential Cookies<\\/b><br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">\\u00a0 \\u00a0These cookies are necessary for the operation of our website and app. They enable you to navigate through the platform and use core features such as logging in and making bookings. Without these cookies, some services may not function properly.<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\"><b>2. Performance and Analytics Cookies<\\/b><br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">\\u00a0 \\u00a0These cookies help us understand how visitors interact with our platform by collecting and reporting information anonymously. We use this data to improve the performance and usability of our services. For example, analytics cookies track the number of visitors and the pages they visit.<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\"><b>3. Functionality Cookies<\\/b><br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">\\u00a0 \\u00a0Functionality cookies allow our website and app to remember choices you have made in the past, such as your preferred bus route, language settings, and payment preferences. These cookies provide you with a more personalized experience.<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\"><b>4. Advertising and Targeting Cookies<\\/b><br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">\\u00a0 \\u00a0We partner with third-party advertisers who may place cookies on your device to deliver advertisements that are relevant to you. These cookies collect information about your browsing habits and ensure that the advertisements you see are tailored to your interests. They also limit the number of times you see an ad and help measure the effectiveness of our marketing campaigns.<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\"><br \\/><\\/font><\\/font><p><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">How We Use Cookies<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">We use cookies for the following purposes:<\\/font><\\/font><\\/p><p><span style=\\\"color:rgb(0,0,0);font-family:\'times new roman\';font-size:medium;\\\">\\u00a0 \\u00a0<b>To Improve User Experience:<\\/b> Cookies help us identify and resolve issues with our platform, ensuring a smooth booking experience.<\\/span><\\/p><p><span style=\\\"color:rgb(0,0,0);font-size:medium;font-family:\'times new roman\';\\\">\\u00a0 \\u00a0<b>To Personalize Services:<\\/b> We store your preferences to offer a customized and seamless user journey.<\\/span><br \\/><span style=\\\"color:rgb(0,0,0);font-size:medium;font-family:\'times new roman\';\\\">\\u00a0 \\u00a0<b>For Marketing Purposes:<\\/b> By collecting information on your interactions with our platform, we display relevant promotions and offers.<\\/span><br \\/><span style=\\\"color:rgb(0,0,0);font-size:medium;font-family:\'times new roman\';\\\">\\u00a0 <b>To Analyze Website Traffic:<\\/b> Cookies allow us to track visitor statistics, helping us improve content and services.<\\/span><br \\/><\\/p><p><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\"><br \\/><\\/font><\\/font><\\/p><p><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">Third-Party Cookies<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">We may use third-party cookies from trusted partners such as Google Analytics, Facebook Pixel, and advertising networks to deliver targeted ads and analyze user behavior. These third-party services have their own cookie policies, and we do not control the collection or use of information by these cookies.<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\"><br \\/><\\/font><\\/font><\\/p><p><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">Consent for Cookies<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">In compliance with Indian regulations, particularly the Information Technology (Reasonable Security Practices and Procedures and Sensitive Personal Data or Information) Rules, 2011, we seek your explicit consent before placing cookies on your device. By continuing to use our website or app after being informed about the use of cookies, you are giving us consent to store cookies on your device.<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">You will be given the option to manage or block cookies via a pop-up when you visit our website for the first time. You can also withdraw consent at any time by managing your cookie preferences in your browser settings.<\\/font><\\/font><\\/p><p><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\"><br \\/><\\/font><\\/font><\\/p><p><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">Managing and Disabling Cookies<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">You can control the use of cookies through your browser settings. Below are the general steps to disable cookies:<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">- For Google Chrome:<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">\\u00a0 1. Open Chrome and click on the three vertical dots in the top-right corner.<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">\\u00a0 2. Go to \\\"Settings\\\" and scroll down to \\\"Privacy and Security.\\\"<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">\\u00a0 3. Click on \\\"Cookies and Other Site Data\\\" and select your preferred settings.<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">- For Mozilla Firefox:<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">\\u00a0 1. Open Firefox and click on the three horizontal lines in the top-right corner.<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">\\u00a0 2. Go to \\\"Options\\\" and select \\\"Privacy &amp; Security.\\\"<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">\\u00a0 3. Under \\\"Cookies and Site Data,\\\" choose your cookie preferences.<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">- For Safari:<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">\\u00a0 1. Open Safari and click \\\"Preferences\\\" in the top menu.<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">\\u00a0 2. Go to the \\\"Privacy\\\" tab and manage cookies.<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">Please note that disabling cookies may limit some functionalities on our platform, such as the ability to log in, make bookings, or view personalized offers.<\\/font><\\/font><\\/p><p><span style=\\\"color:rgb(0,0,0);font-size:medium;font-family:\'times new roman\';\\\"><br \\/><\\/span><\\/p><p><span style=\\\"color:rgb(0,0,0);font-size:medium;font-family:\'times new roman\';\\\">Data Retention<\\/span><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\"><br \\/><\\/font><\\/font><\\/p><p><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">Cookies store data such as session identifiers, which do not personally identify you but may be linked to information we store in our database. This data is stored for a period necessary to fulfill the purposes outlined in this policy or as required by law.<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">We ensure that all personal data collected via cookies is protected according to the security practices outlined in our Privacy Policy, and we comply with the data retention provisions outlined by Indian law.<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\"><br \\/><\\/font><\\/font><\\/p><p><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">Updates to Our Cookie Policy<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">We may update this Cookie Collection Policy from time to time to reflect changes in the law or our practices. The updated version will always be available on our website and app. We encourage you to review this policy periodically to stay informed about how we are using cookies.<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\"><br \\/><\\/font><\\/font><\\/p><p><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\"><br \\/><\\/font><\\/font><\\/p><p><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">Contact Us<br \\/><\\/font><\\/font><\\/p><div style=\\\"text-align:center;\\\"><span style=\\\"color:rgb(0,0,0);\\\">If you have any questions or concerns about our use of cookies, or if you wish to manage your cookie preferences, please contact us at:<\\/span><\\/div><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">Ghumantoo Bus\\u00a0<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font color=\\\"#000000\\\" size=\\\"3\\\">Email: contact@vindhyashrisolutions.com<br \\/><\\/font><\\/font><font face=\\\"times new roman\\\"><font size=\\\"3\\\"><font color=\\\"#000000\\\">Customer Support:\\u00a0<\\/font><span style=\\\"color:rgb(119,119,119);\\\">\\u00a0<\\/span><a href=\\\"tel:+91208269566034\\\" style=\\\"color:rgb(119,119,119);background-color:rgb(255,255,255);\\\">+91 8269566034<\\/a><\\/font><\\/font>\"}', '2022-01-30 13:27:14', '2024-09-26 14:21:34'),
