(90, 'policies.element', '{\"title\":\"Ticket Policies\",\"details\":\"<p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;color:rgb(0,0,0);font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\"><\\/p><div class=\\\"mb-2 flex gap-3 empty:hidden -ml-2\\\"><div class=\\\"items-center justify-start rounded-xl p-1 flex\\\"><span style=\\\"font-size:0.875rem;\\\">Welcome to Ghumantoo! Our Ticket Policy outlines the terms and conditions related to ticket purchases, modifications, and general guidelines for your travel experience. By booking a ticket through Ghumantoo, you agree to comply with the following policies.<\\/span><br \\/><\\/div><\\/div><div class=\\\"flex max-w-full flex-col flex-grow\\\"><div class=\\\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words [.text-message+&amp;]:mt-5\\\"><div class=\\\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\\\"><div class=\\\"markdown prose w-full break-words dark:prose-invert dark\\\"><h2><font size=\\\"4\\\">1. Ticket Booking Process<\\/font><\\/h2><ul><li><strong>Online Booking<\\/strong>: Tickets can be booked via our website or mobile app. Users must provide accurate information during the booking process.<\\/li><li><strong>Booking Confirmation<\\/strong>: Once the booking is completed, a confirmation will be sent to your registered email address or via SMS. Please keep this confirmation handy for your journey.<\\/li><\\/ul><h2><font size=\\\"4\\\">2. Ticket Types<\\/font><\\/h2><ul><li><strong>Regular Tickets<\\/strong>: Standard tickets for regular travel, subject to availability.<\\/li><li><strong>Premium Tickets<\\/strong>: Enhanced travel experience with added amenities, available for select routes.<\\/li><li><strong>Reserved Seating<\\/strong>: Some operators may offer reserved seating options; availability may vary.<\\/li><\\/ul><h2><span style=\\\"font-size:large;color:rgb(52,73,94);\\\">3. Payment Terms<\\/span><br \\/><\\/h2><ul><li><strong>Payment Methods<\\/strong>: We accept various payment methods, including credit\\/debit cards, net banking, and digital wallets. All payments must be completed in full at the time of booking.<\\/li><li><strong>Transaction Security<\\/strong>: All transactions are processed through secure payment gateways, ensuring your payment information is protected.<\\/li><\\/ul><h2><font size=\\\"4\\\">4. Ticket Modifications<\\/font><\\/h2><ul><li><strong>Changing Travel Dates<\\/strong>: Users can request changes to their travel dates through the Ghumantoo platform. Availability of changes is subject to bus operators\' policies.<\\/li><li><strong>Passenger Information<\\/strong>: If you need to modify passenger details, please contact customer support for assistance. Modifications may require verification.<\\/li><\\/ul><h2><font size=\\\"4\\\">5. Boarding Pass and Ticket Verification<\\/font><\\/h2><ul><li><strong>Electronic Ticket<\\/strong>: Users will receive an electronic ticket (e-ticket) upon booking. This ticket serves as proof of your purchase.<\\/li><li><strong>Boarding Process<\\/strong>: Present your e-ticket on your mobile device or a printed copy when boarding the bus. Ensure that your name matches the details on the ticket.<\\/li><\\/ul><h2><font size=\\\"4\\\">6. Travel Regulations<\\/font><\\/h2><ul><li><strong>Identification Requirements<\\/strong>: All passengers are required to carry a valid government-issued ID. This may include an Aadhaar card, passport, or driver\'s license, depending on local regulations.<\\/li><li><strong>Punctuality<\\/strong>: It is crucial to arrive at the boarding point at least 30 minutes before the scheduled departure time. Delays may result in missing the bus, for which Ghumantoo will not be responsible.<\\/li><\\/ul><h2><font size=\\\"4\\\">7. Child and Infant Policy<\\/font><\\/h2><ul><li><strong>Child Tickets<\\/strong>: Children above the age of 5 must have a separate ticket. Children under 5 may travel free of charge if they do not occupy a seat.<\\/li><li><strong>Age Verification<\\/strong>: Passengers may be required to provide proof of age for child passengers. Ensure to carry necessary documents if applicable.<\\/li><\\/ul><h2><font size=\\\"4\\\">8. Special Assistance<\\/font><\\/h2><ul><li><strong>Accessibility Needs<\\/strong>: If you require special assistance due to a disability, please inform us at the time of booking. We will do our best to accommodate your needs.<\\/li><li><strong>Elderly and Pregnant Passengers<\\/strong>: Special provisions can be made for elderly and pregnant passengers. Please contact customer support for specific arrangements.<\\/li><\\/ul><h2><font size=\\\"4\\\">9. Luggage Policy<\\/font><\\/h2><ul><li><strong>Luggage Allowance<\\/strong>: Each passenger is generally allowed one piece of hand luggage and one piece of checked luggage, subject to weight limits set by the bus operator.<\\/li><li><strong>Excess Luggage<\\/strong>: Additional charges may apply for excess luggage. Ensure to check with the operator regarding their specific luggage policies.<\\/li><\\/ul><h2><font size=\\\"4\\\">10. Liability and Disclaimer<\\/font><\\/h2><ul><li><strong>Limitation of Liability<\\/strong>: Ghumantoo is not liable for any loss, damage, or inconvenience caused by circumstances beyond our control, including but not limited to delays, cancellations, or other operational issues.<\\/li><li><strong>Travel Risks<\\/strong>: Passengers are responsible for their safety during travel. We recommend that you take all necessary precautions.<\\/li><\\/ul><h2><font size=\\\"4\\\">11. Governing Law<\\/font><\\/h2><ul><li><strong>Applicable Law<\\/strong>: This Ticket Policy is governed by the laws of India. Any disputes arising from this policy will be subject to the jurisdiction of the courts in Reva, Madhya Pradesh.<\\/li><\\/ul><h2><font size=\\\"4\\\">12. Changes to the Ticket Policy<\\/font><\\/h2><ul><li><strong>Policy Updates<\\/strong>: Ghumantoo reserves the right to modify this Ticket Policy at any time. Changes will be communicated via our website and will take effect immediately upon posting.<\\/li><\\/ul><h2><font size=\\\"4\\\">13. Contact Us<\\/font><\\/h2><p>For any questions or concerns regarding our Ticket Policy, please contact our customer support team:<\\/p><ul><li><strong>Email<\\/strong>: <font color=\\\"#007bff\\\">info@vindhyashrisolutions.com<\\/font><\\/li><li><strong>Phone<\\/strong>: +91-9111888584<\\/li><li><br \\/><\\/li><\\/ul><p>Thank you for choosing Ghumantoo for your travel needs! We look forward to providing you with a comfortable and enjoyable journey.<\\/p><\\/div><\\/div><\\/div><\\/div>\"}', '2022-02-19 19:53:30', '2024-10-05 13:41:52'),
(91, 'amenities.element', '{\"title\":\"Blanket\",\"icon\":\"<i class=\\\"fas fa-bed\\\"><\\/i>\"}', '2024-06-07 09:28:47', '2024-06-07 09:28:47'),
