(93, 'faq.element', '{\"question\":\"Do I need to carry a physical ticket?\",\"answer\":\"No, you do not need a physical ticket. Upon booking, you will receive a confirmation email and SMS with your booking details. Just show the e-ticket on your mobile device when boarding the bus.\"}', '2024-10-05 13:23:28', '2024-10-05 13:23:28'),
(94, 'faq.element', '{\"question\":\"Can I modify or cancel my booking?\",\"answer\":\"Yes, you can modify or cancel your booking through your account on our website or app. Please check our cancellation policy for details on any applicable fees or timelines.\"}', '2024-10-05 13:24:03', '2024-10-05 13:24:03');
